import React, {useState} from 'react'

function Increment() {
    const [Count, setCount] = useState(0);
    const Increment = () =>{
        setCount(Count + 1);
        return(Count);
    }
}


export default function Count(){
    return(
        <div>
            <button onClick={Increment}></button>
        </div>
    )
}
